INSERT INTO "Questions" VALUES (39, 39, 'Please indicate any obstacles your country has encountered when try to access aquatic genetic resources of farmed aquatic species and their wild relatives outside of your country (including access for research purposes).', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 37');
INSERT INTO "Questions" VALUES (40, 40, 'Does your national research programme support the conservation, sustainable use and development of aquatic genetic resources of farmed aquatic species and their wild relatives? If yes, give details of current and/or planned research; if no, explain the main reasons why not in box below.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 38');
INSERT INTO "Questions" VALUES (41, 41, 'Please list main institutions, organizations, corporations and other entities in your country that are engaged in field and/or laboratory research related to the conservation, sustainable use and development of aquatic genetic resources of farmed aquatic species and their wild relatives.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 39');
INSERT INTO "Questions" VALUES (42, 42, 'What capacity strengthening is needed to improve national research in support of the conservation, sustainable use and development of aquatic genetic resources of farmed aquatic species and their wild relatives?', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 40');
INSERT INTO "Questions" VALUES (43, 43, 'Please indicate the extent that education, training and extension in your country covers the conservation, sustainable use and development of aquatic genetic resources of farmed aquatic species and their wild relatives? List the main institutions involved and the types of courses offered.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 41');
INSERT INTO "Questions" VALUES (44, 44, 'Please list any mechanisms within your country responsible for coordinating the aquaculture, culture-based fisheries and capture fisheries subsectors with the other sectors that use watersheds and coastal ecosystems and have impacts on aquatic genetic resources of wild relatives of farmed aquatic species (e.g., agriculture, forestry, mining, tourism, waste management and water resources).', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 42');
INSERT INTO "Questions" VALUES (45, 45, 'Please indicate how capacity strengthening can be improved in intersectoral coordination in support of the conservation, sustainable use and development of aquatic genetic resources.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 43');
INSERT INTO "Questions" VALUES (46, 46, 'Please list any national networks in your country or any international networks your country belongs to that support the conservation, sustainable use and development of aquatic genetic resources.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 44');
INSERT INTO "Questions" VALUES (47, 47, 'Please list any information systems existing in your country for receiving, managing and communicating information about the conservation, sustainable use and development of aquatic genetic resources of farmed aquatic species and their wild relatives.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 45');
INSERT INTO "Questions" VALUES (48, 48, 'What capacity strengthening is needed to improve national information systems to support the conservation, sustainable use and development of aquatic genetic resources?', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 46');
INSERT INTO "Questions" VALUES (50, 50, 'Please list the priority needs regarding collaboration on conservation and sustainable use of aquatic genetic resources of farmed aquatic species and their wild relatives. Are they being addressed, i.e. are there any critical gaps?', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 48');
INSERT INTO "Questions" VALUES (51, 51, 'Please describe the types of collaboration that have been most beneficial for your country, and why?', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 49');
INSERT INTO "Questions" VALUES (52, 52, 'Is there a need for your country to expand its collaboration concerning the conservation, sustainable use and development of aquatic genetic resources? If yes, give details, including any requirements for capacity strengthening in box below', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 50');
INSERT INTO "Questions" VALUES (53, 53, 'Describe important roles that your country performs within its region (and/or sub-region) and globally in terms of being a keeper, user and sharer of aquatic genetic resources.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 51');
INSERT INTO "Questions" VALUES (2, 2, 'The main objective of the Introduction is to present an overview that will allow a person who is unfamiliar with the country to appreciate the context for the Country Report. The Introduction should present a broad overview and present background information from your country on farmed aquatic species, their wild relatives and culture based fisheries. Detailed information should be provided in the main body of the Country Report. Countries may wish to consider developing their Introductions after completing the main body of their Country Reports.', NULL, NULL, NULL, NULL, NULL, NULL, 'Introduction');
INSERT INTO "Questions" VALUES (33, 33, 'Please rank (from 1 – 10) the importance of the following objectives for ex situ conservation of aquatic genetic resources of farmed aquatic species and their wild relatives in your country', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 31');
INSERT INTO "Questions" VALUES (34, 34, 'Please indicate the principal stakeholder groups who have interests in aquatic genetic resources of farmed aquatic species and their wild relatives including, inter alia: fish farmers; fishers in capture fisheries; persons involved in stocking and harvesting in culture-based fisheries; persons employed in postharvest chains; government officials; staff and members of aquaculture associations; managers of aquatic protected areas and others working for the conservation of aquatic ecosystems; researchers; and civil society.', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 32');
INSERT INTO "Questions" VALUES (49, 49, 'Please list the international, regional or sub-regional agreements your country subscribes to that cover aquatic genetic resources of farmed species and their wild relatives, such as the Nagoya Protocol2 the Convention on Biological Diversity and the Cartagena Protocol and how to have impacted aquatic genetic resources and stakeholders in your country. Examples could include:<br />· Establishment and management of shared or networked aquatic protected areas as far as wild relatives of farmed aquatic species are concerned<br />· Aquaculture and culture-based fisheries in transboundary or shared water bodies<br />· Sharing aquatic genetic material and related information<br />· Fishing rights, seasons and quotas as far as wild relatives of farmed aquatic species are concerned<br />· Conservation and sustainable use of shared water bodies and watercourses as far as wild relatives of farmed<br />aquatic species are concerned<br />· Quarantine procedures for aquatic organisms and for control and notification of aquatic diseases', NULL, NULL, NULL, NULL, NULL, NULL, 'Question 47');
